import Sidebar from "../components/Sidebar";

function SidebarContainer({ setAuthState, props }) {
    return (
        <>
            <Sidebar setAuthState={setAuthState}/>
            <div className="ml-64">{props.children}</div>
        </>
    );
}

export default SidebarContainer;
